import React, { useState } from 'react';
import axios from 'axios';
import './LoginSignup.css';

function App() {
  const [isSignup, setIsSignup] = useState(false);
  const [isAdmin, setIsAdmin] = useState(false); // New state for admin mode
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [errorMessage, setErrorMessage] = useState('');
  const [loading, setLoading] = useState(false);

  const handleFormSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    // Password match validation for signup
    if (isSignup && password !== confirmPassword) {
      setErrorMessage('Passwords do not match');
      setLoading(false);
      return;
    }

    // Define endpoints based on user/admin login
    const endpoint = isSignup ? 'signup' : (isAdmin ? 'admin/login' : 'login');

    try {
      const data = isSignup ? { username, email, password } : { email, password };
      const response = await axios.post(`http://localhost:5000/${endpoint}`, data);
      
      console.log(response.data);

      if (isSignup) {
        window.alert('Sign Up Successful!');
      } else {
        // Save the token (could save separate tokens for user and admin if needed)
        localStorage.setItem('token', response.data.token); 
        
        // Redirect based on role
        if (isAdmin) {
          window.alert('Admin Log In Successful!');
          window.location.href = '/admin-dashboard'; // Redirect to admin dashboard
        } else {
          window.alert('User Log In Successful!');
          window.location.href = '/user-dashboard'; // Redirect to user dashboard
        }
      }
    } catch (error) {
      setErrorMessage(error.response?.data?.message || 'An error occurred');
    } finally {
      setLoading(false);
    }
  };

  // Toggle between login/signup and user/admin modes
  const switchMode = () => {
    setIsSignup(!isSignup);
  };

  const toggleAdminMode = () => {
    setIsAdmin(!isAdmin); // Switch between user and admin login
  };

  return (
    <div className="app-container">
      <div className="form-container">
        <h2>{isAdmin ? 'Admin' : 'User'} {isSignup ? 'Sign Up' : 'Log In'}</h2>
        <form onSubmit={handleFormSubmit}>
          {errorMessage && <div className="error-message">{errorMessage}</div>}
          
          {isSignup && (
            <div className="form-group">
              <label>Username:</label>
              <input
                type="text"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
            </div>
          )}
          <div className="form-group">
            <label>Email:</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label>Password:</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>
          {isSignup && (
            <div className="form-group">
              <label>Confirm Password:</label>
              <input
                type="password"
                value={confirmPassword}
                onChange={(e) => setConfirmPassword(e.target.value)}
              />
            </div>
          )}
          <button type="submit" disabled={loading}>
            {loading ? 'Submitting...' : isSignup ? 'Sign Up' : 'Log In'}
          </button>
          <p onClick={switchMode}>
            {isSignup ? 'Already have an account? Log In' : 'Don\'t have an account? Sign Up'}
          </p>

          <div className="admin-toggle">
            <label>
              <input
                type="checkbox"
                checked={isAdmin}
                onChange={toggleAdminMode}
              />
              Log in as Admin
            </label>
          </div>
        </form>
      </div>
    </div>
  );
}

export default App;
